                "questionPart2": "",
                "questionPart3": "",
                "questionPart4": "",
                "questionPart5": "",
                "answer": "There are two phases in Javascript when the Engine executes the code:\n1.- In the first phase, \"Creation Phase\" the Javascript Engine creates the global object\nand the variable \"this\".Then it takes all Declared Variables \"var x...\"(not the ones only\ninitilized x = ...) and reserves a space in memory for them assigning the value of \"undefined\".\nNext, it reserves space in memory for all Declared Functions , not just the name but the\nentire declared functions (notice that the Engine is not reserving space for Function\nExpressions, they are taken like declared variables because of the word \"var\" hence they\nwere stored in memory and assigned \"undefined\").\n2. The second phase is the code execution, in the order it was written, where the value\nasignment happens and the varibles that were assigned \"undefined\" value receive their real\nvalues.\nThe following code prints \"undefined\"\n\nm();\nfunction m (){\n  console.log(x);\n};\nvar x = 50;",
